# National Register of Historic Places listings in Warren County, Kentucky

This is a list of the National Register of Historic Places listings in Warren County, Kentucky.
This is intended to be a complete list of the properties and districts on the National Register of Historic Places in Warren County, Kentucky, United States. The locations of National Register properties and districts for which the latitude and longitude coordinates are included below, may be seen in a map.
There are 102 properties and districts listed on the National Register in the county.
